import Vue from 'vue';

import { MyClass } from '@/directives/my-class';
Vue.directive('class', MyClass);
import MyScrollbar from '@/components/Scrollbar.vue';
Vue.component('my-scrollbar', MyScrollbar);
import MyPreviewImage from '@/components/Preview-image.vue';

export default Vue.extend({
  components: { MyPreviewImage },
  data() {
    return {
      inited: false,
    };
  },
  mounted() {
    window.index = () => {
      this.$router.push('/');
    };
    window.openApp = (appName, heading) => {
      if (heading) {
        this.$router.push({ path: `/man/${appName}`, query: { heading } });
      } else {
        this.$router.push({ path: `/man/${appName}` });
      }
    };
    window.openSearchPage = keyworks => {
      this.$router.push({ path: '/search', query: { keyworks } });
    };
    if (window.objects) {
      window.objects.search.mismatch.connect(keyworks => {
        this.$router.push({ path: '/search', query: { keyworks, mismatch: 'mismatch' } });
      });
    }
    this.$store.dispatch('init').then(() => {
      this.inited = true;
    });
  },
});
